(function(){Vue.directive('datepicker',{twoWay:true,params:['format'],bind:function(){var $el=$(this.el),vm=this.vm,model=this.expression;$el.datepicker({dateFormat:this.params.format,onSelect:function(date){vm.$set(model,''+$(this).datepicker('getDate'));vm.$validate(true)}});$el.change(function(){vm.$set(model,''+$(this).datepicker('getDate'));vm.$validate(true)})},update:function(val){if(''!==val)$(this.el).datepicker('setDate',new Date(val))}})})()